using System;
using System.Linq;
using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Azure.WebJobs;
using Microsoft.Azure.WebJobs.Extensions.Http;
using Microsoft.Extensions.Logging;

using BlazorApp.Shared;
using Syncfusion.Pdf;
using Syncfusion.Pdf.Graphics;
using System.IO;
using System.Net.Http;
using System.Net;
using Syncfusion.Drawing;
using System.Net.Http.Headers;
using System.Threading.Tasks;
using Microsoft.Azure.WebJobs.Host;
using Syncfusion.Pdf.Parsing;

namespace BlazorApp.Api
{
    public class PDFDocumentFunction
    {       
        static bool isMerge = false;

        [FunctionName("DocumentManipulation")]
        public async Task<string> Run([HttpTrigger(AuthorizationLevel.Function, "get", "post", Route = null)] HttpRequestMessage req, TraceWriter log)
        {
            if (isMerge)
            {
                return MergePDFDocuments();
            }
            else
            {
                return CreatePDFDocument();
            }           
        }
        private string CreatePDFDocument()
        {
            PdfDocument document = new PdfDocument();
            //Add a page to the document.
            PdfPage page = document.Pages.Add();
            //Create PDF graphics for the page.
            PdfGraphics graphics = page.Graphics;
            //Set the standard font. 
            PdfFont font = new PdfStandardFont(PdfFontFamily.Helvetica, 20);
            //Draw the text.
            graphics.DrawString("Hello World!!!", font, PdfBrushes.Black, new PointF(0, 0));
            PdfBitmap image = new PdfBitmap(new MemoryStream(GetImageData()));
            page.Graphics.DrawImage(image, new RectangleF(0, 50, 500, 300));
            MemoryStream ms = new MemoryStream();
            //Save the PDF document  
            document.Save(ms);
            ms.Position = 0;
            isMerge = true;
            return Convert.ToBase64String(ms.ToArray());
        }
        private string MergePDFDocuments()
        {
            PdfLoadedDocument ldoc = new PdfLoadedDocument(GetPDFDocumentData());
            PdfLoadedDocument ldoc1 = new PdfLoadedDocument(GetPDFDocumentData(false));
            PdfDocument document = new PdfDocument();
            document.Append(ldoc);
            document.Append(ldoc1);
            MemoryStream ms = new MemoryStream();
            //Save the PDF document  
            document.Save(ms);
            ms.Position = 0;
            isMerge = false;
            return Convert.ToBase64String(ms.ToArray());
        }
        private byte[] GetImageData()
        {
           return Convert.FromBase64String("");
        }
        private byte[] GetPDFDocumentData(bool firstDocument = true)
        {
            if(firstDocument)
            return Convert.FromBase64String("");
        else
            return Convert.FromBase64String("");
        }      
    }
}
